function fetchData() {
  fetch('http://localhost:3000/api/v1/jobs/erfrfre').then(response => {
    return response.json()
    // console.log(response)
  }).then(data => {
    console.log(data);
  }).catch(error => {
    console.log(error)
  });
}

fetchData()
